import logo from './logo.svg';
import './App.css';
import Form from './components/Form/Form';
import Image from './components/Image/Image';
import { Component } from 'react';
// import React from 'react';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      memes: {}
    }
  }

  getMemes = () => {
    const apiCall = fetch('http://localhost:2000/memes');
    const data =  apiCall.json();
    console.log(data);
    this.setState({
      memes: this.data
    });
  }

  render() {
    return (
      <div className="">
          <Form />
          <div>{this.getMemes()} </div>
          <Image memes={this.memes} />
      </div> 
    );
  }
}


export default App;
